('T018', 'Delete Paper', '1. Go to url : http://locahost/aptana/index.php/papers (action : keyboard)\r\n2. Search papers using search tool present at top right corner\r\n3. Select one of the papers from the list\r\n4. Press Delete button', 'MF010', 'SCR018', NULL, NULL, NULL),
