('T022', 'View Products General', '1. Go to url : http://locahost/aptana/index.php/products (action : keyboard)\r\n2. Search paper code using search tool present at top right corner OR Select All products / Inner/ Outer Boxes from Left navigation menu\r\n3. Select one of the Products from the list', 'MF018', 'SCR022', NULL, NULL, NULL),
('T023', 'View Sketch', '1. Go to url : http://locahost/aptana/index.php/products (action : keyboard)\r\n2. Search paper code using search tool present at top right corner OR Select All products / Inner/ Outer Boxes from Left navigation menu\r\n3. Select one of the Products from the list and select Sketch Tab', 'MF018', 'SCR023', NULL, NULL, NULL),
('T024', 'View Sales Order', '1. Go to url : http://locahost/aptana/index.php/products (action : keyboard)\r\n2. Search paper code using search tool present at top right corner OR Select All products / Inner/ Outer Boxes from Left navigation menu\r\n3. Select one of the Products from the list and select Sales Tab', 'MF018', 'SCR024', NULL, NULL, NULL),
('T025', 'Add Product Catalog', '1. Go to url : http://locahost/aptana/index.php/products (action : keyboard)\r\n2. Press Add button', 'MF013', 'SCR025', NULL, NULL, NULL),
('T026', 'Edit Product Catalog', '1. Go to url : http://locahost/aptana/index.php/products (action : keyboard)\r\n2. Search paper code using search tool present at top right corner OR Select All products / Inner/ Outer Boxes from Left navigation menu\r\n3. Select one of the Products from the list and press Edit button', 'MF014', 'SCR026', NULL, NULL, NULL),
('T027', 'Delete Product', '1. Go to url : http://locahost/aptana/index.php/products (action : keyboard)\r\n2. Search paper code using search tool present at top right corner OR Select All products / Inner/ Outer Boxes from Left navigation menu\r\n3. Select one of the Products from the list and press Delete button', 'MF015', 'SCR027', NULL, NULL, NULL),
('T028', 'Create Sales Order', '1. Go to url : http://locahost/aptana/index.php/salesorder (action : keyboard)\r\n2. Search product code using search tool present at top right corner \r\n3. Select one of the Products from the list', 'MF021', 'SCR028', NULL, NULL, NULL),
('T029', 'Add Delivery Sales Order', '1. Go to url : http://locahost/aptana/index.php/salesorder (action : keyboard)\r\n2. Search product code using search tool present at top right corner \r\n3. Select one of the Products from the list and select Review Sales Order Tab', 'MF021', 'SCR029', NULL, NULL, NULL),
