('T039', 'Edit Total Planning ', '1. Go to url : http://localhost:8088/aptana/likitomi/index.php/planning/ (action : keyboard)\r\n2. Search using the criteria listed\r\n3. Edit the desired cell from the list of search result', 'MF028', 'SCR037', NULL, NULL, NULL),
